import React, { Component } from "react";
import './App.css';
import { render } from '@testing-library/react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      notes: [],
      content: [],
    };
  }

  render() {
    return (
      <div className="App">
        <h1>Notes</h1>
        <form>
          <label className="title">
            Title:
            <input name="title" type="text" id="title" />
          </label>
        </form>
      </div>
    );
  }
}

export default App;
